use soccer;
Drop table  if exists fixture;
Create table fixture (
id BIGINT PRIMARY KEY,
referee_id INT,
timezone VARCHAR(255),
date DATETIME,
timestamp INT,
periods_first INT,
periods_second INT,
venue_id INT,
venue_name VARCHAR(255),
venue_city VARCHAR(255),
status_long VARCHAR(255),
status_short VARCHAR(255),
status_elapsed INT,
league_id INT,
league_name VARCHAR(255),
league_country VARCHAR(255),
league_logo VARCHAR(255),
league_flag VARCHAR(255),
league_season INT,
league_round VARCHAR(255),
home_id BIGINT,
home_name VARCHAR(255),
home_logo VARCHAR(255),
home_winner enum('true','false'),
away_id BIGINT,
away_name VARCHAR(255),
away_logo VARCHAR(255),
away_winner enum('true','false'),
goals_home INT,
goals_away INT,
halftime_home INT,
halftime_away INT,
fulltime_home INT,
fulltime_away INT,
extratime_home INT,
extratime_away INT,
penalty_home INT,
penalty_away INT);
